import React,{Component} from 'react';
import './Frame .css'
import {
    BrowserRouter as Router,
     Link,Route
  } from "react-router-dom";
import Products from '../Products/Products';
class Frame extends Component{
    constructor (props) {
        super(props)
        this.state = {
          anh :'http://localhost:4000/anh/' + this.props.anh
        }
     }
    render(){
        var {match}=this.props;
        console.log(match);
        return(
           <Router>
                <Link   className="frame" to="/shirt/aaa"  >
                    <img className="sizeimg"  src={this.state.anh}  ></img>
                    <p>{this.props.ten} </p>
                    <b>{this.props.gia}</b>
                </Link>
                 
            </Router>
        )
}}
export default Frame
